def model(Ni,wc,di,xc,Nc,dc,wi):
    phi = torch.zeros([amb(2),amb(2)])
    q = pyro.sample('q'.format(''), dist.Uniform(torch.tensor(0.0)*torch.ones([amb(1)]),torch.tensor(1.0)*torch.ones([amb(1)])))
    beta0C = pyro.sample('beta0C'.format(''), dist.Normal(torch.tensor(0.0)*torch.ones([amb(1)]),torch.tensor(320.0)*torch.ones([amb(1)])))
    beta = pyro.sample('beta'.format(''), dist.Normal(torch.tensor(0.0)*torch.ones([amb(1)]),torch.tensor(320.0)*torch.ones([amb(1)])))
    for i in range(1, 2+1):
        for j in range(1, 2+1):
            with pyro.iarange('phi_range_{0}_{1}'.format(i,j), 2,2):
                phi[i-1,j-1] = pyro.sample('phi{0}_{1}'.format(i-1,j-1), dist.Uniform(torch.tensor(0.0)*torch.ones([]),torch.tensor(1.0)*torch.ones([])))
    gamma1 = torch.zeros([amb(1)])
    gamma2 = torch.zeros([amb(1)])
    gamma1=1/(1+(1+torch.exp(beta0C+beta))/(1+torch.exp(beta0C))*(1-q)/q)
    for n in range(1, Nc+1):
        pyro.sample('obs_{0}_100'.format(n), dist.Bernoulli(q), obs=xc[n-1])
        pyro.sample('obs_{0}_101'.format(n), dist.Bernoulli(logits=beta0C+beta*xc[n-1]), obs=dc[n-1])
        pyro.sample('obs_{0}_102'.format(n), dist.Bernoulli(phi[xc[n-1]+1-1,dc[n-1]+1-1]), obs=wc[n-1])
    for n in range(1, Ni+1):
        pyro.sample('obs_{0}_103'.format(n), dist.Bernoulli((1/(1+torch.exp(-beta0C+beta)))*q+(1/(1+torch.exp(-beta0C)))*(1-q)), obs=di[n-1])
        pyro.sample('obs_{0}_104'.format(n), dist.Bernoulli(phi[1-1,di[n-1]+1-1]*(1-q)+phi[2-1,di[n-1]+1-1]*q), obs=wi[n-1])
    gamma2=1/(1+(1+torch.exp(-beta0C-beta))/(1+torch.exp(-beta0C))*(1-q)/q)
    
